    [],nt"revision_timestamp": "2016-11-18T20:00:34.307012",nt"name": "archeological-survey-and-cultural-resources-overview",nt"isopen":
    false,nt"url": null,nt"notes": "Archaeological field survey within the
    Santee National Wildlife Refuge, Clarendon County, South Carolinais summarized.
    Five archaeological sites were discovered, and a number of other sites were revisited.
     A summary o f archaeological investigation in the Refuge area is presented, including
    a partial analysis of existing site files and collections. The recovered archaeological
    remains document human useof the area from the Paleo-Indian era to the present,
    including an extensive late prehistoric (Mississippian period) settlement. The history
    of previous archaeological research, a review of evidence for past human occupation,
    and a discussion of environmental parameters are used to develop research questions
    tohelp guide future archaeological activity in the Refuge area.",nt"license_title":
